DROP TABLE RED_SOCIAL;   
DROP TABLE ESTUDIANTE;   
DROP TABLE guia_a;       
DROP TABLE MENTOR;       
DROP TABLE participa_en; 
DROP TABLE COMPAÑIA;     
DROP TABLE COLEGIO;      
DROP TABLE MODERADOR;    
DROP TABLE ACTIVIDAD;    
DROP TABLE FASE;         
DROP TABLE JURADO;       


CREATE TABLE COLEGIO
(
  Cod_colegio number(3) NOT NULL,
  Tipo_col varchar2(100) NOT NULL,
  Nombre_col varchar2(100) NOT NULL,
  Direccion_col varchar2(200) NOT NULL,
  Region varchar2(50) NOT NULL,
  Correo_col varchar2(150) NOT NULL,
  PRIMARY KEY (Cod_colegio)
);

CREATE TABLE COMPAÑIA
(
  Cod_cia number(4) NOT NULL,
  Logo varchar2(200) NOT NULL,
  CDescripcion varchar2(1000) NOT NULL,
  Nombre_cia varchar2(100) NOT NULL,
  Colegio_proc number(3) NOT NULL,
  Fase_alcanzada number(2),
  PRIMARY KEY (Cod_cia)
);

CREATE TABLE FASE
(
  Cod_fase number(3) NOT NULL,
  PRIMARY KEY (Cod_fase)
);

CREATE TABLE JURADO
(
  Cod_jurado number(3) NOT NULL,
  JPrimer_nombre varchar2(20) NOT NULL,
  JSeg_nombre varchar2(20),
  JPrimer_apellido varchar2(50) NOT NULL,
  JSeg_apellido varchar2(50),
  Correo_jurado varchar2(150) NOT NULL,
  Linkedin varchar2(200) NOT NULL,
  PRIMARY KEY (Cod_jurado)
);

CREATE TABLE ACTIVIDAD
(
  Nro_act number(2) NOT NULL,
  Link_act varchar(200),
  Comentario varchar2(200),
  Fecha date NOT NULL,
  Nombre_act varchar2(100) NOT NULL,
  Detalle varchar2(200) NOT NULL,
  Cod_fase number(3) NOT NULL,
  Cod_jurado number(3) NOT NULL,
  PRIMARY KEY (Nro_act),
  FOREIGN KEY (Cod_fase) REFERENCES FASE(Cod_fase),
  FOREIGN KEY (Cod_jurado) REFERENCES JURADO(Cod_jurado)
);


CREATE TABLE MODERADOR
(
  cod_moderador number(3) NOT NULL,
  MoPrimer_nombre varchar2(30) NOT NULL,
  MoSeg_nombre varchar2(30),
  MoPrimer_apellido varchar2(50) NOT NULL,
  MoSeg_apellido varchar2(50),
  PRIMARY KEY (cod_moderador)
);

CREATE TABLE RED_SOCIAL
(
  Link varchar2(200),
  RSNombre varchar2(200),
  Cod_cia number(4) NOT NULL,
  FOREIGN KEY (Cod_cia) REFERENCES COMPAÑIA(Cod_cia)
);

CREATE TABLE ESTUDIANTE
(
  Cod_estudiante number(4) NOT NULL,
  EPrimer_nombre varchar2(20) NOT NULL,
  ESeg_nombre varchar2(20),
  EPrimer_apellido varchar2(50) NOT NULL,
  ESeg_apellido varchar2(50),
  Nivel_est varchar2(70) NOT NULL,
  Cod_colegio number(3) NOT NULL,
  Cod_cia number(4) NOT NULL,
  PRIMARY KEY (Cod_estudiante),
  FOREIGN KEY (Cod_colegio) REFERENCES COLEGIO(Cod_colegio),
  FOREIGN KEY (Cod_cia) REFERENCES COMPAÑIA(Cod_cia)
);

CREATE TABLE MENTOR
(
  Cod_mentor number(3) NOT NULL,
  MPrimer_nombre varchar2(20) NOT NULL,
  MSeg_nombre varchar2(20),
  MPrimer_apellido varchar2(50),
  MSeg_apellido varchar2(50),
  cod_moderador number(3) NOT NULL,
  PRIMARY KEY (Cod_mentor),
  FOREIGN KEY (cod_moderador) REFERENCES MODERADOR(cod_moderador)
);

CREATE TABLE guia_a
(
  Cod_cia number(4) NOT NULL,
  Cod_mentor number(3) NOT NULL,
  PRIMARY KEY (Cod_cia, Cod_mentor),
  FOREIGN KEY (Cod_cia) REFERENCES COMPAÑIA(Cod_cia),
  FOREIGN KEY (Cod_mentor) REFERENCES MENTOR(Cod_mentor)
);

CREATE TABLE participa_en
(
  Punt_acum number(3) NOT NULL,
  Cod_cia number(4) NOT NULL,
  Cod_fase number(3) NOT NULL,
  PRIMARY KEY (Cod_cia, Cod_fase),
  FOREIGN KEY (Cod_cia) REFERENCES COMPAÑIA(Cod_cia),
  FOREIGN KEY (Cod_fase) REFERENCES FASE(Cod_fase)
);







