INSERT INTO COMPAÑIA VALUES(1001, 'https://drive.google.com/drive/RKPVxc2ty5YhyZSCKKnQqDh8byCLyemV4', 'La Tech-Bag es capaz de convertirse de un estuche a un escritorio de trabajo móvil para laburar en casa, en la oficina o afines. Además, la Tech Bag tiene la función de inclinar la laptop unos 10 cm para mejorar la comodidad de las personas a la hora de trabajar, evitando las molestias en el cuello. Finalmente, la Tech-Bag tiene la capacidad de almacenar ciertos útiles de trabajo, optimizando el transporte de los materiales. ', 'MUNKA', 153, 4);
INSERT INTO COMPAÑIA VALUES(1002, 'https://drive.google.com/drive/qgnxGUCFUr78i2tjaV3EjAhMB4m4RbAHZ', 'Nos orientamos a hombres y mujeres de 25 a 50 años, algunos tienen malos hábitos alimenticios y otros desean buscar un mejor estilo de vida más saludable y natural, pero La industria ofrece productos dañinos con altos contenidos en azúcar, grasas, químico, etc.  Es por ello que venimos con una nueva propuesta, con un producto que es un jugo natural con alto contenido de vitamina C y baja calorías.', 'SUMAQ YUS', 138, 1);
INSERT INTO COMPAÑIA VALUES(1003, 'https://drive.google.com/drive/nvTnhTnd2AwqXXJKD8ipC45Vr5nrfny7v', 'Breve reseña de nuestro producto: Tabs es una pastilla de café soluble, la cuál ayuda a los clientes amantes del café a consumirlo de una manera sostenible, rápida y eficaz a través de este producto el cuál que no necesitan de una máquina para ser preparada.', 'TABS', 197, 0);
INSERT INTO COMPAÑIA VALUES(1004, 'https://drive.google.com/drive/TB6ATneV7CEfvneezpkhS6PAUczkjhEn7', 'Tras encuestas vimos que hay muchas personas que no conocen una manera personalizada de relajarse, y nos llamó la atención que el 96% de la producción de velas están hechas con base de parafina. Por ello, nosotras proponemos una vela aromática personalizada hecha a base de cera de soya con múltiples funciones. La primera es aportar estética y olores personalizados, la segunda es que el restante de cera se podrá convertir en un hidratante, y el tercero es que podrás plantar tu vela.', 'MALUHIA', 201, 1);
INSERT INTO COMPAÑIA VALUES(1005, 'https://drive.google.com/drive/aFuybmHp6Ecj9L5U3q3rMNyQ8qbuz9zUQ', '+Jobs es una página web que ayuda desempleados, trabajadores informales y emprendedores a mejorar su empleo y potenciar la empleabilidad de ambos a través de una herramienta digital que sirva como espacio de venta, expansión laboral y establezca una relación entre trabajadores y clientes. Ofreceremos un mercado digital donde todos podamos ejercer un servicio o vender un producto al alcance de un click.', '+JOBS', 175, 0);
INSERT INTO COMPAÑIA VALUES(1006, 'https://drive.google.com/drive/Dvmwfe4LRfDwkZ9EGWN96aN7w2UqXTreV', 'Usuario: Público en general que utilice una mascarilla para protección. Problema: Las personas tienen dificultades en el cuidado de la mascarilla al no tener un lugar adecuado donde guardarla. Propuesta: Un protector de mascarilla que ofrece seguridad e higiene en relación a la manipulación de su mascarilla ya que normalmente se coloca en la mesa, las carteras, mochilas, bolsas que no garantizan una higiene correcta.', 'SUPER WELL-BEING', 132, 3);
INSERT INTO COMPAÑIA VALUES(1007, 'https://drive.google.com/drive/9KWFb95bjjbdybyZkhkR6DK45FSSHYBDZ', 'Nos orientamos en hombres y mujeres de 7 a 60 años de edad  quienes por consumen excesivamente mayonesa y cremas dañinas, lo cual se convierte en un mal hábito alimenticio, es por ello que venimos con nuestra propuesta que es una mayonesa elaborado con nuestra exquisita y cremosa palta fuerte, junto, al aceite de oliva, ambos conllevan grandes beneficios para la salud, de modo que también intentamos reducir el riesgo de padecer enfermedades, cardio vasculares, diabetes y mejorar su calidad de vida.', 'ALLIN SUMAK', 138, 2);
INSERT INTO COMPAÑIA VALUES(1008, 'https://drive.google.com/drive/KpTgNctnX28Z4TEEwyRC7X56vXK9LDcSa', 'SISA es un exfoliante de restos de café molido sin químicos agregados para el cuerpo. Empezamos resolviendo desde el punto de origen el problema de la falta de productividad sana hacia el medio ambiente. Al ser una nueva empresa en proceso de creación, hemos pensado en empezar con una producción usando totalmente productos reciclados y ecológicos.', 'KAPHIY ', 154, 4);
INSERT INTO COMPAÑIA VALUES(1009, 'https://drive.google.com/drive/Q6QkztYRDvPxvrzgtcL5gEkuYbET8Qatx', 'Una aplicación para personas entre 13 y 35 que vivan en Perú, que desee recibir una educación ambiental didáctica y tenga acceso a un celular. Queremos solucionar la falta de información e interés acerca de la fauna y flora del Perú y el medio ambiente. Presenta aspectos teóricos y de entretenimiento que vuelven didáctica y divertida la información brindada y difunde actividades ambientales alrededor de la zona en la que vives.', 'KILLAWAÑUY', 147, 2);
INSERT INTO COMPAÑIA VALUES(1010, 'https://drive.google.com/drive/rb2Bb6NB4SLjdRBPFVQTxb3eTWhALJhPQ', 'Jabón laminado elaborado a base de uña de gato y sangre de grado, que contribuyen con el cuidado de las manos ya que tiene propiedades de cicatrización, protección, desinflamación e hidratación de la piel. ', 'T´ARTA THANI', 141, 2);
INSERT INTO COMPAÑIA VALUES(1011, 'https://drive.google.com/drive/kNNxBMnQfPqqEnPAD3mnVQw64BumuBWy6', 'Programa de alfabetización digital orientado a mujeres adultas amas de casa', 'DIGI-ALF', 105, 0);
INSERT INTO COMPAÑIA VALUES(1012, 'https://drive.google.com/drive/qewvk6rdchU4tUXQfDENHMhXaCaXxnhgz', 'Somos una plataforma virtual que brinda el servicio de buscar para productos naturales para los clientes que cuidan su belleza, salud y el medioambiente con productos como: champú, jabón, cremas, etc. El cliente entra a la página y solicita su pedido, lo que hace la empresa es darle toda la información de lo que solicite y la respuesta de su pedido es entregado por mensaje de texto o su correo electrónico.', 'MUNDO NATURALIS', 121, 2);
INSERT INTO COMPAÑIA VALUES(1013, 'https://drive.google.com/drive/v8uhAfFpxenXHSH3BUE37St9WvHwbF3Sn', 'EcoKiru es un cepillo de bambú biodegradable, compostable y plantable que ayuda a los niños de entre 2 a 10 años a cuidar su higiene bucal, aminorar el uso de plásticos y crear un lazo con nuestro medio ambiente a través del uso de recursos eco amigables que le permitirán tener una mágica experiencia al ver su plantita crecer.', 'ECOKIRU CÍA JA', 170, 3);
INSERT INTO COMPAÑIA VALUES(1014, 'https://drive.google.com/drive/QAVeBgrWMWDw3JAd7eeanxxqpJSik5Btt', 'Nuestro producto va dirigido a todas las personas ,  la problemática identificada en que la mayoría de personas no están bien protegidas contra la Covid-19, además de el aumento de contaminación mediante material pastico. Finalmente "Ecowear" el cual es un proyecto de negocio que ayuda a las personas chalacas específicamente a protegerse de la covid-19 a través de implementos de bioseguridad hechos en base de material reciclado.', 'ECO EMPIRE COMPANY', 174, 0);
INSERT INTO COMPAÑIA VALUES(1015, 'https://drive.google.com/drive/dWxixb2uZUv9jnhNUthHwuyJtt667c3uy', 'Publify es una app en la cual pequeños emprendimientos publican sus productos y por un costo extra nosotros los promocionamos para que tengan más alcance, estos emprendimientos tienen que ser peruanos, además puedes entrar a nuestra app como comprador o vendedor.', 'PUBLIFY', 195, 3);
INSERT INTO COMPAÑIA VALUES(1016, 'https://drive.google.com/drive/HqWb5aXwUcEabj92BAhXVfK9DuMhiBZW4', 'Samariy Bar es un alimento que ayuda a mujeres de 15 a 35 años que sufren de cólicos menstruales para aliviarlos a través de una barra hecha a base de ingredientes orgánicos. Este producto ofrece bienestar, efectividad y accesibilidad a las mujeres que lo necesiten ya que además de sus componentes, tiene un precio razonable y se puede encontrar en tiendas de fácil acceso.', 'SAMARIY', 147, 3);
INSERT INTO COMPAÑIA VALUES(1017, 'https://drive.google.com/drive/jkZK4YcqbZkeKyLBLGmJ53TJYWtZgKLWy', 'Usuario: Estudiantes de secundaria Problema: Necesitan sostener su celular o webcam en sus clases virtuales y al mismo tiempo hacer otras actividades. Propuesta de Valor: El producto es accesible y tiene diferentes modelos Z base es un soporte de celular que ayuda a los estudiantes a sostener su dispositivo en sus clases virtuales y al mismo tiempo hacer otras actividades', 'BACELCAM', 210, 1);
INSERT INTO COMPAÑIA VALUES(1018, 'https://drive.google.com/drive/kiQaBC2PMVuqQPRQYMgqaihS2kipPJtWY', 'Es un bus interprovincial que llevara en su interior, material educativo y didáctico, computadoras, libros, textos, pizarra tecnológicas, Internet, TV, útiles escolares para los estudiantes de las zonas rurales y urbanos marginales que no pueden estudiar virtualmente por la situación de la pandemia.', 'AWE (ADVENTURE WITH EDUCATION)', 116, 3);
INSERT INTO COMPAÑIA VALUES(1019, 'https://drive.google.com/drive/gweW8xucj67yLvJaneFXGkc8JCLGvAUN6', 'Queremos llegar a adolescentes que no son conscientes de los problemas que suceden día a día, vendiendo ropa ecológica para informar a la población a través de mensajes/imágenes que representen cada una de estas dificultades (maltrato físico y psicológico, acoso sexual, discriminación a personas con discapacidades, etc.) y durante este proceso cuidar el medio ambiente.', 'SONGOYPY CCANKI (ESTÁS EN MI CORAZÓN)', 149, 4);
INSERT INTO COMPAÑIA VALUES(1020, 'https://drive.google.com/drive/fDn6q52Am2kVCBMZjh2AjHHqVfGCfezNt', 'Pancakes Miski son panqueques a base de cereales y frutos secos que ayudan a los adolescentes de entre 11 a 19 años a combatir problemas de anemia, diabetes y mejorar su alimentación a través de un snack o desayuno práctico y saludable con productos de origen peruano.', 'PANCAKES MISKI CÍA JA', 170, 5);
INSERT INTO COMPAÑIA VALUES(1021, 'https://drive.google.com/drive/EeR4JyqzNkhfgL3N4gYrTMTKJDFXdNvye', 'Es una mochila elaborada a base de materiales reciclados que ayuda a deportistas y personas que viajan en transportes públicos (estudiantes; viajeros; trabajadores; etc.) esteResuelve principalmente los problemas de incomodidad y del cuidado ambiental.En nuestro producto estará incorporada una pequeña almohadilla, que con la forma de la mochila, ayudara al usuario a tener la comodidad que tanto anhela.', 'BIOSLEEP', 201, 3);
INSERT INTO COMPAÑIA VALUES(1022, 'https://drive.google.com/drive/xRhCe6hEvYHPvBp7FT7bNTCyjH6RFak49', 'Nuestro producto "ChocoInchi" esta dirigido a personas entre 10 y 70 años, que se ven afectadas por el estrés y la ansiedad, debido al confinamiento implementado por el gobierno para prevenir la expansión del covid-19, para solucionar esto, hemos propuesto crear esta crema a base de Cacao y Sacha Inchi que ayuda a disminuir el estrés y ansiedad a través de una crema deliciosa y saludable.', 'CHOCOINCHI', 150, 4);
INSERT INTO COMPAÑIA VALUES(1023, 'https://drive.google.com/drive/DAXD6QuSW47bSrCJiL4zXSyCPJZ6JrgCV', 'Kuaksor es un sitio web que ayuda a estudiantes de nivel primario especialmente de EBR(Educación básica regular) de nuestro País a satisfacer la poca comprensión de sus clases virtuales a través de videos educativos, interactivos, didácticos, además foros, donde estudiantes podrán consultar sus dudas y dificultades obteniendo respuestas 100% fiables.', 'FARMKUAK INNOVATION', 133, 1);
INSERT INTO COMPAÑIA VALUES(1024, 'https://drive.google.com/drive/7uvuaQbZtrVRYagDnzacF7HabJEAHSwPr', 'Nuestro producto es "EL ARMA DEL INKA" consiste en una combinación de ingredientes naturales que tienen muchos beneficios, estos contribuyen  al cuidado de la salud personal, y brinda beneficios tales como: mejorar la memoria y la capacidad de aprendizaje y Prevenir y combatir la anemia.  Esta dirigido a personas entre  20 y 50 años, pero lo pueden consumir desde los 14 años en adelante.', 'NATURAL KICHAY', 128, 2);
INSERT INTO COMPAÑIA VALUES(1025, 'https://drive.google.com/drive/pvM3HydJbhNYaVLFVE46KbmBfPuKQ24Sn', 'Nuestro producto se coloca en el respaldo de la silla. Dicha pieza tiene la misión de proporcionar un apoyo lumbar a través de las formas y hendidura que tienen. Será fabricada en malla transpirable. Esto hace que su manejo e instalación sea más sencillo, ya que pesan poco y son manejables. Así mismo, cuenta con un botón que al activarlo se genera una vibración con el fin de realizar un leve masaje en la zona de la espalda y el cuello. Nuestro producto protege la zona lumbar, que es muy vulnerable y tendente a aparecer lesiones o fatiga.', 'LUMBALIV', 143, 0);
INSERT INTO COMPAÑIA VALUES(1026, 'https://drive.google.com/drive/9829f3XXn4jJeFP3qcpU8xzFAu3MGhYX4', 'En los últimos años la tasa informalidad y desempleo en el país ha crecido a causa de las crisis vividas en los últimos años. Eztego busca beneficiar al sistema laboral mediante el uso de un aplicativo moderno y eficiente. La digitalización es la clave del avance de nuestra sociedad y el uso de la tecnología de punta esta acorde a nuestros tiempos. ', 'LLIKA', 153, 1);
INSERT INTO COMPAÑIA VALUES(1027, 'https://drive.google.com/drive/TzHNyL4gLK8zcx4TG97DT4QyPe99gRzLD', ' La bisutería complementa la manera de vestir, permitiendo a las personas un modo de expresión sin perder el estilo. La bisutería artesanal brinda un mundo de oportunidades sin gastar una fortuna.El concepto de bisutería es sumamente amplio y abarca una serie de ornamentos contemporáneos que incluyen todo tipo de accesorios relacionados con la moda, por ejemplo: pulseras, tobilleras, collares, anillos, etc.', 'HANDMADE', 161, 4);
INSERT INTO COMPAÑIA VALUES(1028, 'https://drive.google.com/drive/QpE3Q9zCZHRUWfyP6S2RjV4Bywqgt9eiZ', 'Nuestro producto es un algodón reusable que ayudará a todas las personas que quieren cuidar de su piel y buscan el mejor producto en el mercado. Nuestra propuesta de valor se enfoca en producir una solución sostenible en cuanto a cuidado del ambiente y en cuidar la piel con los mejores materiales de producción para los pads de algodón.', 'ILAALI', 201, 5);
INSERT INTO COMPAÑIA VALUES(1029, 'https://drive.google.com/drive/Gy2nb9WiUYcVwHnz5xTkertfhTpBBKGHe', 'Una  cartera a base de cuero vegetal, la cual brinda seguridad a las mujeres en caso de algún tipo de violencia en las calles.', 'KIPINA', 194, 1);
INSERT INTO COMPAÑIA VALUES(1030, 'https://drive.google.com/drive/jPxLVtW4YSyEPU7t84mJhYZ3mYJCg92bC', 'Usuario: Personas con problemas de saludProblema: La mala alimentacion de las personas Propuesta de valor: Es un producto saludables y rico que ayuda con enfermedaes por sus propiedades e incluso ayuda con la prevencion de enfermedades ', 'SONQOYKIPI', 175, 1);
INSERT INTO COMPAÑIA VALUES(1031, 'https://drive.google.com/drive/x6NG7eGpLv9jKxAKceumMJ6hFkQi6FgqG', 'Nuestro servicio tiene como público objetivo a los adolescentes entre 12 y 17 años del Perú. La idea de negocio consta de una Página Web y una App, mediante las cuales se va a brindar sesiones grupales con atención personalizada para manejar el estrés, además se ofrece productos de relajación y anti-estrés elaborados a bajo costo por la compañía misma, de esta manera de plantea contribuir a la mejoría académica de los estudiantes.  ', 'KUSI', 135, 1);
INSERT INTO COMPAÑIA VALUES(1032, 'https://drive.google.com/drive/hpkwbGgpk27DzCkGkCRqMazz5dmwTUg2A', 'EcoMask es una mascarilla ecológica elaborada a base de almidón de yuca que tiene como finalidad minimizar el impacto de la producción y desechos sanitarios masivos durante la pandemia a través de su material biodegradable, el cual, además, brinda al público una opción accesible y de identidad cultural.', 'NEXTGEN', 135, 1);
INSERT INTO COMPAÑIA VALUES(1033, 'https://drive.google.com/drive/5uMuyXazP5WjH9Ym7DkubXiRgBNAq2FK9', 'A raíz de la pandemia y la precariedad en la que se desarrolla la educación en el Perú para con los niños y adolescentes de nuestro, hemos propuesto un web educativa en donde podrán reforzar y nivelar sus aprendizajes de manera divertida (clases pre-grabadas, juegos, retos, etc.)', 'STUDY BAG', 201, 4);
INSERT INTO COMPAÑIA VALUES(1034, 'https://drive.google.com/drive/4JH44mUaa5aBRqrqAJzi9RdA7DFKfaXWA', 'Son galletas nutritivas que esta centrado mayormente en niños y adolescentes para poder reforzar su sistema inmune de una manera rica. ', 'C+FUERTE', 148, 5);
INSERT INTO COMPAÑIA VALUES(1035, 'https://drive.google.com/drive/TLHeAHpkYPiJQM8ytRZwLJiGJMfNDMKuk', 'Liwe es una almohadilla que se a creado principalmente para los teletrabajadores, ya que están más de 7 horas sentados al día, y esto puede causar problemas a lo largo del tiempo como las hemorrroides, mala postura, estrés, entre otros. Lo que nosotros proponemos es una alternativa para poder mejorar la calidad de vida de nuestros usuarios, pero a diferencia de otros nosotros lo ofrecemos a un costo mucho más accesible y ajustable a la economía.', 'LIWE', 157, 3);
INSERT INTO COMPAÑIA VALUES(1036, 'https://drive.google.com/drive/biyHgmAKEnAkyeikkWphcJixhxPV7CaPX', 'Ante la terrible contaminación que ha venido causando el plástico de los productos desechables una gran parte de los adolescentes y adultos jóvenes pertenecientes en su mayoría al sector ABC han tomado conciencia de la situación y quieren un cambio. Bambuc ofrece para ellos un cepillo de bambú biodegradable,  con cerdas intercambiables, una tapa para ser transportado y con una semilla para que se recicle hasta el mango a buen precio.', 'BAMBUC', 201, 0);
INSERT INTO COMPAÑIA VALUES(1037, 'https://drive.google.com/drive/ZQgWaumk8ADvyrJKK5WKaVqiVF9wgMe8b', 'Qhali Kay es un inmunoestimulante capaz de reforzar el sistema inmunológico ante el ataque de una enfermedad, con la mayor inocuidad posible.Este producto logra aumentar las defensas del consumidor al ser alta en vitamina C.', 'VS', 150, 1);
INSERT INTO COMPAÑIA VALUES(1038, 'https://drive.google.com/drive/FkWq73qguk9YWeQaggMxvpBM6XDRz6pgT', 'Nuestra idea de negocio es la venta de productos de higiene personal biodegradable, a fin de contrarrestar el uso excesivo de plástico y de productos químicos que dañan el ambiente y perjudican la salud, Además contribuimos a la mejora del medio ambiente proponiendo que por el uso de nuestros productos se siembre una semilla de esperanza qué hará que disminuya el problema del calentamiento global.', 'ECOITEMS', 215, 1);
INSERT INTO COMPAÑIA VALUES(1039, 'https://drive.google.com/drive/2taQQwGHWzFMPJiWR9Ug3LhjiAQ8cSEq2', 'KAI es un hoodie (polera) que ayuda a hombres y mujeres entre los 18 a los 30 años del sector A/B a facilitar su aporte en cuanto a la preservación del medio ambiente a través de ropa cómoda ecoamigable.', 'KALEU', 154, 1);
INSERT INTO COMPAÑIA VALUES(1040, 'https://drive.google.com/drive/6HiaqJu9DqqH9njz7GbEPPKmmG7EyMbCK', 'Jayani es una Eco-libreta hecha con hojas de papel de piedra, este papel es eco-amigable y además reutilizable, esto quiere decir que puedes borrar y volver a escribir. El papel que estamos utilizando se borra con una toalla húmeda, siempre y cuando se use un lapicero de tinta borrable. Este producto reduce la tala de árboles y la necesidad de comprar muchas libretas. Además esta libreta viene con planners semanales para que te puedas organizar. ', 'JAYANI', 154, 1);
INSERT INTO COMPAÑIA VALUES(1041, 'https://drive.google.com/drive/g5hKL6YcBgMpZReJ5iVTPqGq7WAv3rgcm', 'Nuestro producto está dirigido a jóvenes de 16 a 21 años, pero lo pueden utilizar personas de otras edades. El problema que nosotras identificamos fue la alta tasa de contaminación producida por el consumo excesivo del plástico. Para ayudar a solucionar esto, nosotras hemos propuesto una cañita de acero inoxidable con su limpiador, este vendra dentro de un pequeño estuche (con llavero) eco-friendly. ', 'MAWKA ', 154, 3);
INSERT INTO COMPAÑIA VALUES(1042, 'https://drive.google.com/drive/v9vTVB6zY5cUrex8PTi65rTbdCWFrDiPY', 'Es una App que ayuda en la organización de tareas, también constara con una alarma que avise constantemente las tareas pendientes en el transcurso del día. ON TIME se dividirá en: Administrador: El se encargara de crear el horario, admitirá a los estudiantes, seleccionará a los editores y podrá agregar las tareas. Editores: se encargaran de colocar las tareas en la plataforma. Alumnos: marcan la tarea como completada y se auto elimina. ', 'ON TIME', 155, 1);
INSERT INTO COMPAÑIA VALUES(1043, 'https://drive.google.com/drive/abPfXuxY7SnW7Jgjc5djACAWxCGzB6V8y', 'Resert es una aplicación/página web que ayuda a resolver problemas, brindar apoyo, servicio técnico y concientización sobre la salud a creadores de contenido y gamers a través de una accesibilidad total, personalizada y comprensible para todos.  ', 'RESERT', 182, 2);
INSERT INTO COMPAÑIA VALUES(1044, 'https://drive.google.com/drive/g5vRbiGgewpk2xdFzPGX73GaUaRxBFi2D', 'EPA es una aplicación que ayuda a los jóvenes adultos (entre 18 y 28 años) que no saben sobre primeros auxilios a instruirse sobre cómo actuar ante situaciones de emergencia a través de material interactivo, además, tendrá propósitos educativos para uso en las escuelas.', 'EPA (EDUCACIÓN DE PRIMEROS AUXILIOS)', 182, 1);
INSERT INTO COMPAÑIA VALUES(1045, 'https://drive.google.com/drive/Gjr2m2gy4z2XG7NV7Fwx7cpieZQACz62y', 'Nuestra idea de negocio es un servicio/producto que está dirigido hacia los  estudiantes de nivel básico-regular, que se encuentran con la disyuntiva del desorden y estrés, por la falta de organización, es por ello que nuestra idea de negocio se centra en  un proceso de mejora en cuanto a la relación de los estudiantes con estos ámbitos.', 'MAUDISAYA', 195, 3);
INSERT INTO COMPAÑIA VALUES(1046, 'https://drive.google.com/drive/gwbH6nYWj2qkcZ22TkWYBuFpzwHcnwDaK', 'Nuestros usuarios son estudiantes, principalmente adolescentes. El problema que hemos hallado es la dificultad al organizarse para estudiar. Nuestra propuesta de valor es una aplicación que te ayuda a facilitar tu organización, incrementar tu productividad y te ahorra tiempo al aprender.', 'YOUTH', 208, 3);
INSERT INTO COMPAÑIA VALUES(1047, 'https://drive.google.com/drive/PJupRrtE5WpeiczDT9jftxivbhrjkX5JS', 'Tienda de productos saludables para personas con enfermedades que generan restricciones alimenticias (diabetes, celiaquía, hipertension, entre otros). Igualmente, esta dirigido a personas de bajos recursos, en otras palabras, los productos a vender seran mas economicos que los productos ya existentes en el mercado.', 'VITAR', 197, 5);
INSERT INTO COMPAÑIA VALUES(1048, 'https://drive.google.com/drive/NVz3ZCJRbTPxxjry9xLbwZYA8MP7Eg9fQ', 'El aislamiento social influye de manera negativa en el desarrollo de las habilidades intrapersonales de los adolescentes peruanos entre los 13 y 17 años, interrumpiendo el fortalecimiento de las mismas. Partiendo de este problema, diseñamos nuestra propuesta de valor, Conéctate Contigo; un diario guía que brindará recursos, actividades y estrategias didácticas, reflexivas e interactivas con el fin de fortalecer sus habilidades intrapersonales.', 'EUNOIA', 221, 2);
INSERT INTO COMPAÑIA VALUES(1049, 'https://drive.google.com/drive/PqWyeM6EiXMpNdxZdL57bAcuFBZzKSxCE', 'Los agricultores y personas amantes de las plantas necesitan un abono eficaz el cual ayude a la aceleración del proceso de producción de plantas. Nosotros presentamos un abono orgánico el cual este hecho a base de desechos orgánicos, ya que son contaminantes y desagradables para sociedad debido a el proceso de descomposición el cual será reducido gracias a la producción de este abono además recoger los desperdicios de la población.', 'ALIVE EART COMPANY ', 187, 5);
INSERT INTO COMPAÑIA VALUES(1050, 'https://drive.google.com/drive/zBa7wnXcUe9nat8xrpdZ6RYA2ZBkNzFGK', 'Proporcionamos un alimento saludable y a su vez natural, ya que no pasa por procesos químicos y de esta manera seguimos teniendo su valor nutricional, el cual es un tocosh de papa fácil de preparar, con esencias frutales; un producto apetitoso para todos sin necesidad que se sienta su olor desagradable y además que refuerza nuestro sistema inmunológico, brindando salud a todo publico .', 'GRUPO  TOKO - TOKO', 101, 1);
INSERT INTO COMPAÑIA VALUES(1051, 'https://drive.google.com/drive/p3qWQJikrr2kRh6tRgGGPv2kvnrMPu4eD', 'Digimarket, es una aplicación que tiene como propósito dar información sobre los productos y mercaderes a los compradores, para ahorrarles dinero y tiempo. Ahora con este coronavirus, ayuda a prevenir las aglomeraciones y a su vez el contagio de esta enfermedad tan contagiosa.', 'WIRSTAY COMPANY ', 134, 1);
INSERT INTO COMPAÑIA VALUES(1052, 'https://drive.google.com/drive/BHgSje5j9g7PxiNHjqq26ijgxmcr4p3GX', 'Problema :Educación de calidad en tiempos de pandemia ,Usuario :Estudiantes de colegios públicos de nivel  secundario del sector de Miguel Grau ,Propuesta de valor :Es un servicio de apoyo y ayuda al estudiante para  mejorar su calidad de educación  y aprendizaje a través de diversos recursos tecnológicos  mediante una enseñanza personalizada por medio de videollamadas .', 'TECHGENIES', 107, 5);
INSERT INTO COMPAÑIA VALUES(1053, 'https://drive.google.com/drive/UXEthagruSnpj4Hx66qTrMcWDyR62zMLb', 'Es una pagina web, diseñada para adolescentes, que soluciona el problema de la inactividad física y mala salud, proporcionando al usuario ejercicios según su capacidad cardiaca, así como orientaciones de salud en general. ', 'SALUD DEPORTE Y BIENESTAR (SADEBI)', 107, 0);
INSERT INTO COMPAÑIA VALUES(1054, 'https://drive.google.com/drive/wBPNi7CpSvFmQigHWgHmUGtgjemHwyeFQ', 'Ofrecemos experiencias vivenciales descentralizadas a jóvenes de 5to año de secundaria que buscan ser agentes de cambio, con el fin de que aumente su visión y se potencie el desarrollo humano de su región. Nuestro objetivo es combatir un problema que afecta a todo el Perú: el centralismo.', 'YATIX', 173, 0);
INSERT INTO COMPAÑIA VALUES(1055, 'https://drive.google.com/drive/kaEk43TUbxMFLqPARu4N8VNJ4zWGUQXTX', 'Qmara es un aplicativo móvil que orienta nutricional y psicologicamente a los jóvenes egresados de la universidad  que acaban de ser diagnosticados con las enfermedades de: Hipertiroidismo, Hipotiroidismo, Anemia, Obesidad...... Les brindamos a nuestros clientes la   información que necesitan a través de dietas, planes nutricionales y material interactivo adecuado a su enfermedad.', 'MAISHA', 122, 0);
INSERT INTO COMPAÑIA VALUES(1056, 'https://drive.google.com/drive/HCnuNcSntG4B48J6jEDvDQdrbLtVu7YpU', 'KIRIKIRI es una aplicación que ayuda a jóvenes estudiantes a organizar mejor el tiempo para sus actividades académicas, sociales y su cuidado personal a través de un asistente virtual personalizado de acuerdo a las necesidades del usuario', 'BLACK BEFORE', 139, 2);
INSERT INTO COMPAÑIA VALUES(1057, 'https://drive.google.com/drive/2PwmkzRRSvKqYgjcTzwkGupTjjCptiPUq', 'El uso de fertilizantes químicos genera un gran impacto dañino en el medio ambiente y ecosistemas, perjudicando nuestra salud, puesto que la industria de la agricultura brinda productos contaminados químicamente y desecha residuos potencialmente reutilizables. Nuestro fertilizante orgánico ayudará a personas de todas las edades con afinidad o gusto por las plantas y escazo espacio o tiempo, libre de químicos y sin repercusiones en la salud.', 'WANU RUYU', 196, 4);
INSERT INTO COMPAÑIA VALUES(1058, 'https://drive.google.com/drive/YRfKQKXxkV2kFHDpAuFXbLZJRBr6H42S9', 'Nuestro producto CHOCOMU (Mermelada de mucílago de cacao) esta destinada para las personas de todas las edades, gracias a su contenido de teobromina, lo que produce efectos positivos en nuestra memoria y concentración; así como en la reducción de niveles de estrés, viendo eso, surge la idea de aprovechar todos los beneficios que nos aporta el mucílago de cacao y convertirlo en una jalea.', 'MISKY KAKAW', 150, 4);
INSERT INTO COMPAÑIA VALUES(1059, 'https://drive.google.com/drive/yLK9w25wuhDTQNhnkVWreH3vqfABaDeMW', ' Es una App que ayuda a los pre-universitario, tanto de bajos recursos como a los invidentes, a elegir una carrera y universidad conveniente a través de este servicio.', 'ITS APP TO YOU', 150, 2);
INSERT INTO COMPAÑIA VALUES(1060, 'https://drive.google.com/drive/e29myfcfZXGug5C525GBWkzk3n2L5UL5p', 'Qata, es una manta imperneable que esta diseñada para que los niños, jovenes, adultos puedan compartir un momento de sano esparcimiento en la playa, campo, parques o centros deportivos. Hemos identificado que nuestro producto soluciona la incomodidad en los lugares mencionados. ', 'POKI', 153, 0);
INSERT INTO COMPAÑIA VALUES(1061, 'https://drive.google.com/drive/9NrFZ7BzJEx4nYZt2Cfep2rnMAj8RCuJ8', 'Estas muñec@s serán confeccionadas de tela y tendrán de vestimenta la que elijan los usuarios, podrán venir vestidas de astronauta, doctoras, abogadas etc., tendrán un collar distintivo como una placa donde se grabará el nombre de la mascota a la que ayudó su compra.', 'LATIDOS DOGS', 168, 0);
INSERT INTO COMPAÑIA VALUES(1062, 'https://drive.google.com/drive/mNdSuQ6acfDgK6UGfrvHrgZiR8XQfAXG6', 'Buscamos más que nada a trabajadores y estudiantes que tienen problemas para organizarse en casa, más que nada ahora que hay un cambio de espacio por la pandemia. Este producto ya que tiene paredes adaptables y en diferentes tamaños, es más atractivo y fácil de usar, lo cual ayuda al cliente en diversos sitios. Nosotros vamos a ayudarlos a organizarse de una manera más cómoda y sencilla con nuestro organizador hecho de residuos de madera para re usar la madera que termina siendo quemada por las grandes empresas y que daña el medio ambiente. ', 'KARWAN', 201, 0);
INSERT INTO COMPAÑIA VALUES(1063, 'https://drive.google.com/drive/Jip5DhAk49cTt4L9THrQU38vXPnCq6udA', 'Delivery Aprendo en Casa, utiliza la herencia de los apuntes , entregando actividades educativas, realizando consultas y canjes de actividades.', 'DELIVERY APRENDO EN CASA', 107, 4);
INSERT INTO COMPAÑIA VALUES(1064, 'https://drive.google.com/drive/wJmNbddEfRLNdYf8u9SZbqLn93EcJUh5W', 'HealLife es una App que ayuda a los adolescentes y jóvenes a disminuir el estrés y a resolver el mal cuidado de la salud a través de las actividades físicas, al igual que otras app lo proporcionan, pero que a diferencia de ellas, esta presenta un avatar personalizado por el cliente, que le ayudara en el cumplimiento de las actividades planeadas, por medio del entretenimiento y la motivación.', 'HEALLIFE', 127, 4);
INSERT INTO COMPAÑIA VALUES(1065, 'https://drive.google.com/drive/Ma4xKgpnwkXwMbfiQywPbnDdzhMwgQakZ', 'Se basa en la creación de las galletas o otros postres, que se encargaran de reemplazar los azúcares dañinos con "Estevia". Buscando así que eliminar los malos estilos de vida de las personas.', 'HEALTHY LIFE', 161, 0);
INSERT INTO COMPAÑIA VALUES(1066, 'https://drive.google.com/drive/FDkn4chzg58H3ehhGwtvJnSLRpMYCkxtq', 'El problema que nosotros detectamos fue que las personas realizan las compras (entre 25-60 años) suelen compras cosas de más y no pueden llevarlas con comodidad. Baggie es un bolso que puede convertirse en un carrito de compras, para así comprar como acomode más al cliente. Está hecho con paja, tejida por las señoras de Monsefú, Lambayeque, a quienes damos trabajo para que crezcan más económicamente.', 'BAGGIE', 201, 0);
INSERT INTO COMPAÑIA VALUES(1067, 'https://drive.google.com/drive/DfCNHFub4rahDcWSQbauGVwhZ5CVA9gwF', 'Es un artículo de oficina y de casa, que brinda seguridad ante los posibles accidentes de derrame de líquidos que por lo general se consume cuando se está trabajando o recreando con dispositivos electrónicos o papelería importante, cuyo deterioro sería costoso.', 'ADIUTERU', 209, 4);
INSERT INTO COMPAÑIA VALUES(1068, 'https://drive.google.com/drive/fw2Y54WpawriLK8bT27kxd7Y38kKVMk5Z', 'Es un producto que va dirigido a niños mayores de 5 años y menores de 18, el padre adquiere el producto, nos enfocamos en mejorar la salud de nuestros clientes, nuestro producto previene y contraataca las enfermedades de desnutrición y ayuda a regular los niveles de glucosa en la sangre, nos diferenciamos de las demás empresas ya que nuestros productos se hacen a base de ingredientes naturales y no muy conocidos por el público.', 'ALLIÑANMI CASKA ', 174, 4);
INSERT INTO COMPAÑIA VALUES(1069, 'https://drive.google.com/drive/XFz2377tQq5wFY4gcYpqxGLuLexKrMcM5', 'Producto que va a dirigido a personas estresadas o bajo presión. Es un cubo que, a cada lado, tiene una función diferente que ayuda al cliente a distraerse y/o desestresarse. Desde 5 botones a un cuarzo que absorbe energía negativa se pueden encontrar en nuestro cubo. También tiene una voz personalizada, la cual te dirá frases motivadoras seleccionadas por el propio comprador, esto será posible gracias a una aplicación afiliada al producto.', 'CALMCUBE', 194, 2);
INSERT INTO COMPAÑIA VALUES(1070, 'https://drive.google.com/drive/nfXpZkCxL7QhfvbA5E83pW62AewSzAVhE', 'Bottle Bag, lleva vida a todos ladosBottle Bag es una mini mochila con el objetivo de facilitar las actividades al aire libre como ejercicio, camping... llevando objetos tan simples como una botella pero que pueden llegar a ser muy incómodos de llevar, además de llevar un panel solar para cargar dispositivos. ', 'COVA: CORPORACIÓN DE VENTAS ASISTIDA', 157, 3);
INSERT INTO COMPAÑIA VALUES(1071, 'https://drive.google.com/drive/exLnEx4vGGCpMA5kbedSmUF6wrDrL6vUw', 'Nuestro usuario son personas que viven en una casa y que utilizan luz eléctrica, el problema es el cambio climático y las tarifas mensuales que pagan nuestros usuarios para la luz eléctrica, la propuesta  es una maseta lámpara que utiliza energía renovable, esta puede reemplazar a los foco comunes.', 'GEOLAMP', 150, 1);
INSERT INTO COMPAÑIA VALUES(1072, 'https://drive.google.com/drive/4BNgQXGkhacXUT4daDMxDT6zizgSPDA7M', 'Es una tienda, que ayuda a personas mayores de 15 años que viven en la ciudad de Arequipa y cuenten con mascotas a conseguir artículos y accesorios económicos, y con una gran variedad accesorios a través de  modelos con materiales reciclados.', 'KOKUNAI FASHION S.A.C', 102, 3);
INSERT INTO COMPAÑIA VALUES(1073, 'https://drive.google.com/drive/MhW7CtuHZ8i3cTVa3aqQ4HSpxAti4yNJf', 'Niños de 6,7 y 8 años que necesitan entender sus clases virtuales para ello se crea grupos de whatsapp por edades y categorías o cursos y ayudar con su aprendizaje escolar.', 'EASY EDUCATION', 110, 3);
INSERT INTO COMPAÑIA VALUES(1074, 'https://drive.google.com/drive/aFfpLpqArpXD49piUY9FmDfzcj3pNxUde', 'Nuestro proyecto consiste en promover el cultivo de plantas en el hogar de manera que este estará equipado con una mesa de cultivo y un kit completo para el cultivo, la mesa de cultivo estará con diferentes diseños, según a preferencia del cliente.', 'MUYA', 218, 0);
INSERT INTO COMPAÑIA VALUES(1075, 'https://drive.google.com/drive/xvZbRRyxgdghJ7mzUUj7Et5LES7yMXzSx', 'En la actualidad el Perú es uno de los países que cuenta con una de las tasas de anemia más grandes de toda Latinoamérica, sin embargo es productor de alimentos que poseen propiedades que ayudan a aumentar los glóbulos rojos, como el higo, cuyo precio es cómodo y accesible; es por esto que CEO Company busca crear una mermelada en base a este y otros productos naturales para ayudar a niños de 5 a 7 años de la ciudad de Trujillo y así ayudar a estos a disminuir sus niveles de anemia.', 'CEO COMPANY', 134, 1);
INSERT INTO COMPAÑIA VALUES(1076, 'https://drive.google.com/drive/wqLu8vJ2S4u7Va4RkzzwdrYwQTKhz8ubC', 'Nos hemos percatado que los aficionados a la pintura, mayoritariamente jóvenes y adultos, usan diversos tipos de pintura que son altamente tóxicos y dañinos para el medio ambiente, dañándolo muy fuertemente. Para esto, hemos diseñado  acuarelas Picturinca, un kit de acuarelas ecológicas que buscar reducir el daño a la naturaleza que produce las acualeras comunes al estar compuesto de componentes no toxicos, ecologicos y biodegradables.', 'PICTURINCA', 145, 4);
INSERT INTO COMPAÑIA VALUES(1077, 'https://drive.google.com/drive/nL8QcgGfLLw4RLyjPS6HDXbiYpiwfzgcU', 'Crema a base de ingredientes naturales que aprovecha las propiedades del aloe vera para contrarrestar la sequedad y el acné en la piel, nos interesa el tema del cuidado de la piel, ya que según el MINSA el 85% de personas entre 13 y 25 años de edad sufren de acné. En todo momento buscamos la confianza y comodidad del cliente y que nuestro producto esté a su alcance económico.', 'FLOR DE RETAMA', 150, 0);
INSERT INTO COMPAÑIA VALUES(1078, 'https://drive.google.com/drive/LSVdhQAqHGFgBFnewTASraYA5qfyJEFEw', 'Nuestra té es una bebida el cual ayuda a personas que sufren el estrés ya sea por el trabajo o el simple hecho de la pandemia, teniendo el conocimiento que hubo escasez de  fármacos para aliviar los malestares proponemos nuestro te con el fin de  solucionar los malestares o tratar de mantener relajadas a nuestros clientes.', 'SACHA WASI', 150, 4);
INSERT INTO COMPAÑIA VALUES(1079, 'https://drive.google.com/drive/dSPSk77CXbwctUcfKRbhA8aePcu8RQRf8', 'BIOPLAST  es un productos elaborado a base de recursos naturales que busca reducir la contaminación ambiental, que daña nuestra afmosfera, y el lugar donde vivimos, tomando uso de cubiertos y platos biodegradables. ', 'BIOPLAST ', 178, 0);
INSERT INTO COMPAÑIA VALUES(1080, 'https://drive.google.com/drive/tFMJbmQLwRmLqEmcBNQUW3S72K8fmuNDC', 'La idea presentada se basa en la población que no cuenta con fluido eléctrico por encontrarse a una distancia alejada de la ciudad y de igual forma porque su medio geográfico no se lo permite, El producto es una maleta que puede absorber energía solar a base de paneles y de igual forma acumular energía eólica a base de hélices, siendo este un almacenado y transformador de energía', 'MOVING ENERGY', 126, 5);
INSERT INTO COMPAÑIA VALUES(1081, 'https://drive.google.com/drive/Jf4Q5aHLi9CRqRJ75kPKWRt7mDkg5tqd5', 'Usuario: Una persona incomprendida rodeado de un mundo moderno.Problema: Sufre de problemas de concentración y desmotivada. Propuesta de Valor: App que le ayudará a una mejor organización de su tiempo e información. Será una agenda virtual que contará con diferentes funciones como screenshots, ejerc. de respiración, reloj (bloqueara otras apps), porcentaje de tu proceso, entre otras más.', 'RIRAKKUSU', 175, 4);
INSERT INTO COMPAÑIA VALUES(1082, 'https://drive.google.com/drive/Qq9dnDyunqC3GpwYjnrqrhWFFgMB2QA7C', 'Meal On! Es un aplicativo móvil que permite organizar tus horarios alimenticios y recomendar a los usuarios distintas recetas saludables, de acuerdo a las necesidades de cada persona.', 'MEAL ON!', 118, 3);
INSERT INTO COMPAÑIA VALUES(1083, 'https://drive.google.com/drive/RXvCrjSZkW3uCJLAgEHLK5rEmSY72VxGR', 'ATCE es un aplicativo móvil diseñado especialmente para orientar e incentivar al usuario a generar emprendimiento gracias a su información almacenada en la plataforma; debido a la inestabilidad generada por la coyuntura actual, nos preocupamos por el bienestar económico de nuestros usuarios y brindamos soporte e información para que de esta manera nuestros clientes activen su creatividad e inicien su emprendimiento.', 'ATCE', 131, 4);
INSERT INTO COMPAÑIA VALUES(1084, 'https://drive.google.com/drive/pw2QFQNzCHcT5J6Kq2xJuDvT4KYcgV8Ya', 'Miski es producto alimenticio que ayuda a las personas con diabetes tipo 1 permitiéndoles degustar algo dulce (gomitas) sin causar daños en su salud a través de unas gomitas de kiwi, chía y sanqui, que no sólo no afectan sino que regulan la diabetes debido a sus bajo IG. ', 'MIRAI ', 135, 2);
