INSERT INTO COMPAÑIA VALUES(1087, 'https://drive.google.com/drive/N3Eiudr3zYvcJ5YYdSBFUi9x6fXcENhV8', 'El usuario es la población limeña (clase A y B)  preocupada por el impacto de los materiales no reciclables en el medio ambiente y en su salud. Nuestro producto es un vaso con un sistema plegable de silicona de grado alimenticio (sin BPA). Este filtra café e infusiones a través de una malla metálica, permitiendo que el consumidor obtenga una bebida instantánea,  sin emplear productos descartables, sin sacrificar la calidad y la comodidad.', 'MUJU', 154, 3);
INSERT INTO COMPAÑIA VALUES(1088, 'https://drive.google.com/drive/Qccxh8PXJcN3aPnXkQe3uw3429mBXJA7W', 'EL Kit Mujercitas, esta diseñada para  señoritas de 9 a 16 años que en  la llegada de la Menarquia- Menstruación, experimentan el bulling, la desconfianza y temor de hablar de estos temas. En este Kit recibirán todos los productos necesarios, 100% ecológicos, cuidando desde el primer momento la salud de la niña o srta, permitiendo que vivan una Menstruación Sostenible, de una manera libre y sana.', 'CATANISH', 212, 5);
INSERT INTO COMPAÑIA VALUES(1089, 'https://drive.google.com/drive/ZvrmD49k4DU9YEzc6GdDNeTEkPKHZig73', 'Nuestro producto va dirigido a adolescentes, jóvenes y adultos mayores que padecen dolores musculares o corporales y padecen de estrés. Con este producto su rendimiento académico o laboral mejorará y también solucionará los problemas anteriores. Este producto consiste en compresas de arroz que van de la mano con una aplicación que promete tener diferentes actividades y maneras de organización al igual que especificaciones sobre las compresas. ', 'DÉTENDEZ-VOUS', 211, 3);
INSERT INTO COMPAÑIA VALUES(1090, 'https://drive.google.com/drive/iQHWD9ShyFUzZUu4xFmgK79qZLqiS9mcd', 'Un cargador solar, fuente autónoma de energía portátil; estos utilizan energía solar fotovoltaica, captura dicha energía y recarga la batería interna del dispositivo, una opción asequible y preferible para usuarios de energía eléctrica que aspiran de una energía mas barata, limpia y al alcance del lugar a donde vayan.', 'INFINERGY', 178, 5);
INSERT INTO COMPAÑIA VALUES(1091, 'https://drive.google.com/drive/NtxiV3feVceV9M7qzQv69gyKCPAvHzwbN', 'Nuestra compañía se estará encargado de vender Inti Boxes las cuales tienen el fin de desinfectar ítems domésticos aprovechando luz U.V.C. El producto podrá funcionar adicionalmente  con energía solar, ayudando así, a promover el uso de la misma en los lugares más desfavorecidos.', 'HEALTH  WELLNESS COMPANY (HWC)', 118, 5);
INSERT INTO COMPAÑIA VALUES(1092, 'https://drive.google.com/drive/fpNnrcEepngrqazx64L6YYLHzCcT7tgJb', 'Majaleta es una paleta de helado natural  que ayuda a las personas mayores de 15 años con diabetes a controlar sus niveles de azúcar en la sangre a través de un producto elaborado a base de las propiedades del Macambo, un fruto de nuestra selva amazónica que contiene alta concentración de fibra y omega 9.', 'ZELCKA ', 141, 1);
INSERT INTO COMPAÑIA VALUES(1093, 'https://drive.google.com/drive/T6SKNYHRhpzUcc6WLnEpHP7gppddzyxkL', 'Kit Hominem es un conjunto de productos y/o accesorios de limpieza y uso personal, además es ecoamigable que ayuda a adolescentes, jóvenes y adultos a satisfacer problemas de la higiene personal y a la vez estrés que se tiene en estas épocas a través de los productos que son respetuosos a la naturaleza, al medio ambiente y otros métodos por explotación sostenible; por lo tanto, también son desprovistos de cualquier elemento tóxico, teniendo un precio accesible y justo', 'HOMINEM', 157, 5);
INSERT INTO COMPAÑIA VALUES(1094, 'https://drive.google.com/drive/FVneNEkFYgqbvrQgJ8Q2VUZJT2zkfM9v3', ' Es una aplicación que promueve la venta de productos ecológicos  y la fabricación de ladrillos de plástico para la construcción de casas para personas de escasos recursos.', 'WASSI', 201, 3);
INSERT INTO COMPAÑIA VALUES(1095, 'https://drive.google.com/drive/7VpKjdT3gDc6vRzSXCWQWFqcg2ihptSiG', 'Es una app llamada Aina que significa tierra en Hawaiano, consiste de diversos retos y por cada que completes subes de nivel. Esta app contiene retos ecológicos que enseñaran a las personas a cómo ayudar el medio ambiente  de una forma divertida de esta manera estaremos activando una conducta de ayuda ecológica en las personas.', 'AINA', 201, 5);
INSERT INTO COMPAÑIA VALUES(1096, 'https://drive.google.com/drive/kcXy6GmiyMFpM2TUNkAjiLKRy7jeambur', 'Debido a la inmoderada contaminación a causa del plástico, hemos concluido en utilizarlo aprovechando en manera que nos beneficie a nuestra comunidad Peruana, por lo tanto hemos puesto en marcha la reutilización del plástico convirtiéndolo en un Ladrillo Ecológico: Este producto es hecho a base de plástico, ayudando a bajar la cantidad de plástico desechado. Esto nos ayuda en forma ambiental, economía e infraestructural.', 'NEW WORLD ', 178, 0);
INSERT INTO COMPAÑIA VALUES(1097, 'https://drive.google.com/drive/pMWKS7hURFEZf9UZkfpYe6q9Dm9buGqS2', 'Nos dirigimos a padres con hijos con TEA(leve/moderado), el problema que identificamos es que en nuestro país hay poco acceso y/o disponibilidad de recursos de estimulación temprana para niños con TEA y la propuesta de valor es realizar una pagina web con actividades que ayudan a desarrollar y fortalecer hábitos saludables y una comunicación efectiva a través de estrategias didácticas y lúdicas, ilustraciones y dibujos animados.', 'MISI COMPANY UNA CÍA. JA', 221, 5);
INSERT INTO COMPAÑIA VALUES(1098, 'https://drive.google.com/drive/SqC5dZAGCZFPRSTrpCzYkrR2LqDnYYJv7', 'Nuestro usuario Mario Casas tiene el problema de fatiga visual por pasar mucho tiempo frente a su computadora y tambien al estar muy cerca de ella. Por eso, nosotros proponemos una mica protectora contra rayos azules para dispositivos electronicos como celulares, laptops, etc. Nuestra propuesta de valor es la proteccion contra rayos azules y una app complementaria que mide la distancia necesaria entre el usuario y la pantalla', 'KANCHAY PAKAQ', 145, 5);
INSERT INTO COMPAÑIA VALUES(1099, 'https://drive.google.com/drive/4VGrQYQw9Y8uktA7eEEb95LLgGygpab7v', 'Es un bolso eco amigable que ayuda a personas que viven en Lima, Perú, entre los 13 y 25 años, del sector económico A y B, que tienen acceso a las redes sociales y están proecupados por la contaminación de la industrialización y el daño que le hace el plástico a la vida marina, a eludir el uso diario de productos que dañan a la biodiversidad en la industria textil, a través de un producto multiusos, que al producirse no perjudica al planeta. ', 'GAIA, UNA CÍA DE JA', 154, 0);
INSERT INTO COMPAÑIA VALUES(1100, 'https://drive.google.com/drive/e86m6fE5UMSCi4aWJZEmFHdtj5x99fYci', 'Deseamos crear un producto que genere confiabilidad y lealtad en nuestros clientes y, además, una promesa de calidad superior de nuestro  producto. Se diferencia por que es versátil, aislante termo - acústico y tiene un amplio radio de uso. Para ello, vamos a mantener los precios relativamente bajos.', 'VIMA', 159, 2);
