INSERT INTO COMPAÑIA VALUES(1102, 'https://drive.google.com/drive/Eq43p3xD8qR4EHMKr9z4UW2TQ5WqAtMZu', 'El usuario nuestro proyecto estará enfocado será a todo el público en general desde niños a adultos. El problema que hemos encontrado es la mala alimentación ,como lo son los postres dulces ,estos contienen demasiada azúcar o grasas saturadas. Serán propuesta de valor: postres con ingredientes que los hará saludables y de consumo libre.', 'NUTRÍ.SABORES', 112, 3);
