INSERT INTO COMPAÑIA VALUES(1111, 'https://drive.google.com/drive/WwuLCdCXfkPxGwwzpXVWd5yM8YcVWdANj', 'El proyecto Qallariy Tiyan es una aplicación para dispositivos móviles que ayuda a las personas con poca experiencia en el mundo de los negocios a sacar a flote sus ideas de negocio o emprendimiento. Brindándoles la seguridad de oportunidades de crecimiento. Para ello, se implementará un modelo eficiente y con orientaciones pertinentes para el buen desarrollo de su proceso. ', 'QALLARIY TIYAN ', 135, 1);
INSERT INTO COMPAÑIA VALUES(1112, 'https://drive.google.com/drive/eHQ9mQ9qVMTBB5zcU86mF2k88cd7T6eyS', 'Proveemos un servicio que sirve para concientizar a las personas sobre el impacto ambiental que genera la basura a través de una pagina web con información de las zonas mas afectadas, nuestro usuario son las personas que observan y viven constantemente estos problemas de contaminación, finalmente el problema es la falta de interés de las personas, por ello estas arrojan su basura en donde quieren y cuando quieren.', 'POCCRA', 168, 1);
INSERT INTO COMPAÑIA VALUES(1113, 'https://drive.google.com/drive/kSGVr3G4nquAS6pQG7KrEPUJwTUvH6HCT', 'qasikay es un servicio de apoyo psicológico dirigido a niños, adolescentes y familias que sufren enfermedades mentales producto del aislamiento social, ofrecemos un asesoramiento diferente en espacios abiertos acompañados de actividades recreativas en contacto con la naturaleza.', 'QASIKAY', 149, 3);
INSERT INTO COMPAÑIA VALUES(1114, 'https://drive.google.com/drive/F2qNgewBcVnY382nGibp4pRwJkBn489TN', 'Nuestra idea de negocio se trata de un set de cubiertos que contienen tenedor, cuchara, cuchillo y sorbete con su respectivo limpiador. El objetivo de vender este producto es que el cliente al comprar, pueda escanear un código QR que vendrá dentro del kit en donde ellos podrán ver más sobre lo que sucede con el plástico en los océanos y como el bambú ayuda a prevenir esto. ', 'ECO KIT BAMBÚ ', 211, 3);
INSERT INTO COMPAÑIA VALUES(1115, 'https://drive.google.com/drive/aARY4iq3YpJxP9834zVvdm93cgnbGCkPZ', 'Los profesores de los primeros grados de primaria sienten estres debido a que sus niños no captan atención a sus clases virtuales,y no encuentran una plataforma que satisfasca sus necesidades. Nuestra solucion consta en crear una página web donde sus clases sean entretenidas y didácticas, con un fácil manejo de las herramientas, y así ya no sufran de estres.', 'E.V.  LEARNING ', 168, 0);
INSERT INTO COMPAÑIA VALUES(1116, 'https://drive.google.com/drive/Vhat9gcQz63Nyp8gTvree53ywC2tEzKht', ' es una combinación entre bullet journal, diario, agenda y planificador dirigido para la planeación de la vida cotidiana,usuario:erán principalmente las personas que quieran y necesiten organizar su vida cotidiana problema y propuesta: la falta de organización que las personas tienen,propuesta crear un planificador que les ayude a planear, programar y organizar su dia a dia con un producto  eficiente  y sencillo.', 'PUNCHAY', 120, 0);
INSERT INTO COMPAÑIA VALUES(1117, 'https://drive.google.com/drive/JuNFRnrUGB5WHyarmBStH6BMjCSJCqdLW', 'Nos basamos en la problemática de los estudiantes universitarios con un trabajo tedioso, ya que en esta situación actual de la pandemia que estamos viviendo conlleva a realizar aprendizajes vía virtual, que permanecen sentados a mas de 10 horas con actividades académicas generando en él, dolores musculares, estrés, por su permanencia de estar sentado; con las sillas RC 21 podrán aliviar dolores musculares, sentirse relajados con el push natural y refrescante de los biohuertos. RC 21 EN TUS MANOS!   ', 'RC 21(RELAXING CHAIR)', 160, 0);
INSERT INTO COMPAÑIA VALUES(1118, 'https://drive.google.com/drive/u5yQ8YexRutxtMQEidfCxTdSUVkXzGmBm', 'Usuario - Embarcaciones Problema -  Casos de emergencia Propuesta de Valor - Es un producto adaptable a cualquier ambiente y fácil de usar que ofrece la posibilidad de conseguir agua mediante un transformador que absorbe de la humedad del aire, así como está hecho con materiales de mayor estabilidad.', 'WATER FROM HEAVEN', 156, 2);
INSERT INTO COMPAÑIA VALUES(1119, 'https://drive.google.com/drive/xLRxmUg5RkCSD9dXqDxLFCwaN4QiwwTnh', 'Un dispositivo adaptable a cualquier accesorio que desee poner nuestro cliente. Usuario adolescentes y adultos victimas de delincuencia. Es un dispositivo de alarma o alerta de emergencia  que ayudara a clientes que se sienten inseguros en lugares no concurridos donde no cuentan con personal de seguridad, este dispositivo les ofrecerá confianza al momento de pasar por estos sitios, ya que va a permitir una comunicación rápida con las autoridades y sus parientes, asimismo brindara acceso a su ubicación, tanto como  grabara audio o video, para tener evidencia de lo sucedido. ', 'CLIC (COMBATIENDO LA INSEGURIDAD CIUDADANA)', 156, 0);
INSERT INTO COMPAÑIA VALUES(1120, 'https://drive.google.com/drive/QebUUfCrELawiGVTpXZce7GRkAJaUXKDC', 'Esto es para personas que se sienten inseguras en la calle. Esto es gracias a la inseguridad que hay en las calles. Para esto esta SIMP que trae su llavero de autodefensa que tiene múltiples funciones. Este llavero consiste en un arma Kubotan, una alarma, funciona como linterna, además cuenta con un chip que se conecta a una aplicación en tu celular para que te localicen .También contiene un gel desinfectante y un llavero decorativo.', 'SIMP', 211, 5);
INSERT INTO COMPAÑIA VALUES(1121, 'https://drive.google.com/drive/5Dvp9y2rqdhthjHRT5duQUhUUHyRHeELy', 'Nuestro público objetivo son adolescentes de 13 a 17 años. El problema es desconocimiento de los beneficios del consumo responsable de algunos granos, semillas y frutos, nativos del Perú, para el estado emocional de los adolescentes. La propuesta de valor es una caja que contiene elementos significativos que promueven emociones agradables como mensajes, productos alimenticios y playlist personalizados.', 'GROZAV', 221, 5);
INSERT INTO COMPAÑIA VALUES(1122, 'https://drive.google.com/drive/FUiZWnFjXAHCAQHFqyLuJWBL9nqRg5WTS', 'nuestro producto esta dirgido para todas las personas mayores de 18 años, pues el problema que hemos detectado es que muchas personas han sufrido daños por algunos medicamentos, por ello nuestro producto esta diseñado para atacar las enfermedad respiratoria como son la tos, la gripe, etc. a traves de la medicina natural o alternativa.', 'KAWSAY THANI ', 112, 5);
INSERT INTO COMPAÑIA VALUES(1123, 'https://drive.google.com/drive/wEZ8Y7aJUtD2CZ3uHxhV9vtqhY58iYq2d', 'Nos dirigimos a las empresas, tiendas o marcas que quieren promover el cuidado del medio ambiente e incentivar el reciclaje. El problema que estos tienen al incentivar a las personas a reciclar es combatir el poco interés que muestran esto y no poder contribuir al cuidado del medio ambiente. Por lo que Wallcing nuestro producto incentiva el reciclaje y compacta los residuos para contribuir a la no acumulación de residuos, a través de un sistema que le permite compactar esta, la diferencia en nuestro producto es una vitrina exhibidora donde pueden colocar el producto que desean para mostrarlo a su público.', 'IMPACT CORPORATION', 135, 3);
INSERT INTO COMPAÑIA VALUES(1124, 'https://drive.google.com/drive/9qpVVQC4HDtYuEVyQyV5zjyX3AMJYB7TG', 'Los usuarios serán los empresarios que necesitan incrementar sus ventas y las personas que requieren adquirir bienes. El problema es la pandemia de Covid 19 que estamos viviendo y que le limita realizar las transacciones ya que nos exponemos a contagiarnos del covid19. Propuesta de valor, el servicio consiste en brindar un canal de ventas seguro a los empresarios y comerciantes de Puerto Maldonado y brindarle a las personas la posibilidad de comprar los bienes sin exponerse al contagio del covid 19', 'YANAPAQUI', 137, 0);
INSERT INTO COMPAÑIA VALUES(1125, 'https://drive.google.com/drive/Mc6aarVZ3a6Ambdmi3ehiKZihB5Ju84Ud', 'Que los doctores y paciente puedan monitorearse remotamente para evitar la necesidad de salir y exponerse a algún contagio.', 'SATUREMOT COMPANY', 111, 5);
INSERT INTO COMPAÑIA VALUES(1126, 'https://drive.google.com/drive/EMAcPaHWX4X6XPePX5AKfJrAwRSyHtCFe', 'Es un juego educativo que ayuda a los peruanos a reconocer su identidad y a los extranjeros a conocer nuestra lengua a través de unas charadas de lenguas peruanas.', 'JUEGOS PERUANOS', 220, 0);
INSERT INTO COMPAÑIA VALUES(1127, 'https://drive.google.com/drive/9AGaTyewv8jkz4qLM48wCeE7tx9F6xQaJ', 'El producto EcKafito busca brindar una alternativa al café para niños y adolescentes de 7 a 18 años, que, asimismo tenga la función de ser un producto eco-amigable. Este producto será una alternativa sana y nutritiva de bebida energizante para estudiantes, que a la par, no generar desechos y contribuye con el medio ambiente.', 'KAHFFY', 193, 2);
INSERT INTO COMPAÑIA VALUES(1128, 'https://drive.google.com/drive/VrnPpRnWUiN7dcizAEZmSTUdJVxjVqWXC', 'Es una aplicación educativa dirija principalmente para niños de primaria, la cual le ayudara a aprender de una manera un poco mas didáctica y divertida para que los niños con dificultad tengan mayor retención de aprendizaje  , en vez de los ejercicios tradicionales tendrán juegos y al final ganar puntos los cuales le ayudaran a conseguir membresías gratis y desbloquear niveles o vidas para seguir avanzando, los ejercicios presentados son algunos ejemplos, no serán los finales.', 'EDEXCO', 156, 2);
INSERT INTO COMPAÑIA VALUES(1129, 'https://drive.google.com/drive/32Q8Z438nFu8KTQjymzpBCKBk435xW8pW', 'En el Peru, mueren mas de 10 mujeres al mes a causa de violencia de genero. Con el llavero de defensa personal AMINAH, todas nos sentiremos mas protegias, empoderadas y libres de cualquier temor que tengamos al estar solas en la calle, universidad o lamentablemente dentro de nuestro propio hogar. Este producto sera para mujeres peruanas mayores de 16 años, pues contendra diversos utensilios disfrazados de productos del dia a dia.', 'AMINAH', 200, 4);
INSERT INTO COMPAÑIA VALUES(1130, 'https://drive.google.com/drive/g3vUMXHRRiWX7LYc9tf3zj45fu8T9hYeN', 'Somos una empresa con la creatividad de diseñar un producto dirigido a dueños de mascotas con bajos recursos económicos, que a su vez, busca reducir y darle un segundo uso a la basura que se encuentra en el planeta, también, con el objetivo de darles una mejor calidad de vida en sus hogares a las mascotas y un pequeño refugios a las abandonadas. ', 'ECO - CONSTRUCCIONES', 118, 5);
INSERT INTO COMPAÑIA VALUES(1131, 'https://drive.google.com/drive/4wYZakizFpXZzUwJyVScUciQrzQS5REqe', 'El ayrampo es una cactácea andina que crece a más de tres mil metros. Es una planta sin hojas y con tallos carnosos, así como de flores grandes y olorosas. Sus frutos, dulces y comestibles, son utilizados para el teñido de textiles y alimentos, además de poseer propiedades medicinales, nuestros usuarios toda la población estudiantil (5 a 25 años), problema( estrés en el modelo de aprendizaje y enseñanza remoto)a través de Muffins de Ayrampo con productos naturales de la región.', 'MISKI AYRAMPO', 130, 0);
INSERT INTO COMPAÑIA VALUES(1132, 'https://drive.google.com/drive/FTzrvpeYEjG3irc2Q6XSL4rujETd4ECjA', 'Es un servicio que permite a los usuarios realizar la búsqueda de un empleo a través de un App que contara con una base de datos de diversos empleadores que publicaran los puestos de trabajo que desean que se cubra por los postulantes que accederán a través de su perfil de trabajador registrados, estos usuarios están comprendidos entre jóvenes de 18 a 25 años, que están en búsqueda de un empleo para iniciar su proyecto de vida futura.', 'TECWORK', 158, 3);
