INSERT INTO COMPAÑIA VALUES(1134, 'https://drive.google.com/drive/2c3tXq3jRjnCbfPempBCMvdMY85MR9XqZ', 'Ama Qonqawaychu son agendas que cuentan con una cubierta con diseños exclusivos basados en la cultura, tradiciones y folklore peruano. Además de eso, por la compra de nuestras agendas podrá acceder de manera gratuita a AQ, nuestra app de organización con la cual podrás organizarte donde quiera que estés. Nuestro producto está orientado a personas que desean poner su vida en orden recordando siempre sus raíces.', 'A LO PERUANO PE', 180, 0);
