INSERT INTO COMPAÑIA VALUES(1136, 'https://drive.google.com/drive/VVthd48BW9Ge2DjcGdKyc9RfXzw9RRdMx', 'Es un producto artesanal muy practico, útil y decorativo, elaborado manualmente a base de cartón reciclado en diversos diseños muy resistentes que te permiten guardar y organizar objetos y a la vez decorar tu espacio del hogar u oficina, especialmente para personas que valoran el trabajo artesanal e interesados por el cuidado del medio ambiente y la ecología.La propuesta de valor que proponemos es la elaboración de un producto organizador de objetos de oficina, utilitario y decorativo, con acabado de calidad y sobre todo con material biodegradable, para conservar el medio ambiente y combatir la contaminación de residuos. ', 'KAYPACHA', 158, 4);
INSERT INTO COMPAÑIA VALUES(1137, 'https://drive.google.com/drive/zWc33qTaDaPt9bKtFBVC8mPW7gM4bNpHD', 'Mucha gente sale a trabajar por necesidad, exponiendo la salud y bienestar de su persona y su familia. Por esto, nuestra propuesta es poder darle mascarillas personalizadas a que garantizan una segura protección al cliente pero que también tengas unos modelos personalizados y exclusivos. Además vamos a agregar un porta mascarillas para que estas tengan buen higiene y no se contaminen. ', 'IRVIS MUSKS', 211, 2);
