INSERT INTO COMPAÑIA VALUES(1140, 'https://drive.google.com/drive/2R3VWKZvr7QY7RDxJDgqWJrMYkFbTSe6i', 'Usuario: Usuario final (niños de 8 - 10), usuario vulnerable (padres). Problema: Niños que sufren de enfermedades (anemia). Padres que no saben como armar la lonchera de su niño, ya sea por falta de tiempo o por desconocimiento. Propuesta de Valor: Creación de Página Web, encontrando variedad de comidas, para amar el plan semanal, llevándola al domicilio. Opcionalmente, adquiriendo una lonchera  hecha por nosotros 100% ecofriendly. ', 'LUNCHBOX.', 122, 1);
