INSERT INTO COMPAÑIA VALUES(1143, 'https://drive.google.com/drive/nk6G4K7ymUB7FBHrBkW7bupRcVTj9guGa', 'Nuestro producto es una agenda de papel reciclado que ayuda estudiantes, trabajadores y emprendedores. Muchos jóvenes no usan responsablemente el papel y lo desechan, nuestro objetivo es promover una cultura en la que usemos responsablemente el papel. Al usar nuestro productos nuestros clientes podrán organizarse y se sentirán bien sabiendo que no daña al planeta.', 'KURURAY', 201, 1);
INSERT INTO COMPAÑIA VALUES(1144, 'https://drive.google.com/drive/PGtv28eaLnKMFWrPqzanGNjdWqiQEUNTW', 'El presente proyecto consiste en la creación de un método capaz de innovar la educación actual. Aprovechando que hoy en día la educación se apoya en la tecnología, este proyecto busca complementar este nuevo método de aprendizaje en linea a través de un sistema que sea capaz de añadirle ciertos atractivos a la hora del aprendizaje y generar interés en los alumnos.', 'PREPEA (PROYECTO ESTUDIANTIL POR EL BUEN APRENDIZAJE)', 107, 4);
