INSERT INTO COMPAÑIA VALUES(1150, 'https://drive.google.com/drive/UfmNR2TvbttEDMmRRZhvMDTVaAwqu9aX2', 'Servicio de enseñanza virtual hacia los estudiantes de secundaria del Callao de 3°, 4° y 5°, ya que nuestra región tiene tasas de retiro, atraso y desaprobación inferiores a los valores nacionales, todos los distritos los presentan con valores inferiores al 10% (MINEDU 2018).Esto solucionaría los problemas de aprendizaje de los alumnos y también los prepara para retos más difíciles como la admisión a una universidad.Lo que nos diferencia del resto es que nosotros seremos los educadores que dictaran las clases compartiendo nuestros conocimientos.', 'A NEW ROAD TO INNOVATION', 174, 1);
