INSERT INTO COMPAÑIA VALUES(1161, 'https://drive.google.com/drive/UL2uHgBnDV4mif5zFtRVCeJvfze2fHVUf', 'El aislamiento social influye de manera negativa en la salud emocional de los jóvenes entre 19 y 25 años. Por ello, diseñamos nuestra propuesta de valor: "Cultivando rutinas saludables", es una planta con una rutina de cuidado que ayuda a las personas a restablecer su salud emocional, a través de la construcción de un vínculo entre ellos.', 'GREEN HOPE', 221, 4);
INSERT INTO COMPAÑIA VALUES(1162, 'https://drive.google.com/drive/5bqHiKbGxQfff49ZutEHNC65uR4vMqhLX', 'Usuario: Los niños y adolescentes, porque según estadísticas son los más propensos a contraer anemia. Problema: Prevenir la anemia y acelerar el proceso de llegar al nivel estándar de hemoglobina. Propuesta de valor: Barra nutritiva, las cuales contienen un alto porcentaje en hierro, calcio y cítricos, debido a que esta compuesta por alimentos alimentos saludables (frutas,verduras) cuidando también el medio ambiente (envoltura biodegradable)', 'OUTBREAK', 135, 5);
