INSERT INTO COMPAÑIA VALUES(1165, 'https://drive.google.com/drive/p3KZvymKnhXXKMa35VcexzCjaWdgTTpeM', 'Somos una empresa de mascarillas diferente a las otras. Proponemos cambios en el diseño de la mascarilla y varios descuentos para que sea asequible para todos. Los usuarios serían las personas cansadas de una mascarillas normal. El problema, el aburrimiento de las personas por una mascarilla común y aburrida. Nuestra propuesta de Valor serían los cambios que le haremos a las mascarillas. Cambios de diseño y con una mejor protección.', 'MASCHOUSE', 211, 3);
INSERT INTO COMPAÑIA VALUES(1166, 'https://drive.google.com/drive/XvGtVQHZzeKeQUmRNzEr2YzHKEADVwrm7', 'A las mujeres (de toda edad) el maquillaje es una de las herramientas más estupendas para aumentar tu belleza, pero la piel sensible suele ser propensa a tener alergias con todos los productos de belleza, por eso necesita ser tratada con productos que no la dañen, es por eso que hemos pensado en un negocio de cosmética natural es una oportunidad para contribuir por un mundo más justo y sostenible que ayude a las mujeres y al medio ambiente.', 'NAT-BEAU( NATURALMENTE HERMOSA)', 140, 5);
INSERT INTO COMPAÑIA VALUES(1167, 'https://drive.google.com/drive/BCqw9iA3APdCGeq5v5PnC7pY9vZJWwZAm', 'Nuestro producto se basa en un dije para mascotas que puede ser personalizado a gusto y necesidad del cliente, está hecho a base de filamentos de PLA en impresoras 3D (ecológicos y no contaminantes) y cuenta en la parte trasera con un código QR que al escanearlo con nuestros dispositivos móviles aparecerán los datos del dueño. Las personas que lo usarán serán aquellas que tengan una mascota y tratamos de resolver la problemática del extravío frecuente de las mascotas. ', 'QMASCOT', 211, 1);
