INSERT INTO COMPAÑIA VALUES(1172, 'https://drive.google.com/drive/N8k4JdgFahECfTQG7b5x2AMTvjW2jkkyW', 'El emprendimiento "" MASITAS""  son productos elaborados para ayudar a la población a combatir la desnutrición y mala alimentación y esto causa problemas de salud por lo tanto el proyecto ayuda a combatir este problema de una manera deliciosa , nutritiva y económica. Nuestro producto es adaptable a diferentes usos como bocaditos en fiestas, reuniones o/u compromisos etc.', 'M A S I T A S ', 112, 2);
