INSERT INTO COMPAÑIA VALUES(1231, 'https://drive.google.com/drive/WRQyxc86pRYJHgiy7Wf6hwfbUhUj8BRpW', 'Psycove es una aplicación que ayuda a las personas con problemas familiares, de parejas, etc. Esta aplicación nos permite comunicarnos con psicólogos para poder resolver los problemas, así mismo podemos comunicarnos con otras personas para saber su experiencia y compartir información.', 'SUNEMERALD', 119, 1);
INSERT INTO COMPAÑIA VALUES(1232, 'https://drive.google.com/drive/85dUqAwYV2d6mLSCmK7uKNzqMefikUUAS', 'Es una aplicación para personas entre 25 a 30 años recién independizándose, que no sepan cocinar, y desean tener una alimentación saludable y balanceada, para mejorar su sistema inmune. Contará con recetas saludables, tips y lugres donde vendan comida organiza y estableceremos alianza con chefs peruanos y nutricionistas', 'KRENTY UNA CIA JA', 168, 1);
