INSERT INTO COMPAÑIA VALUES(1238, 'https://drive.google.com/drive/cy23wFvx9bJuKBTZNMmS7FriiDtdftKHE', 'Safelet es un brazalete que brindará seguridad y confianza a mujeres en situaciones vulnerables o de peligro. Es un gadget que se vincula con un dispositivo móvil, que al ser pulsado, activará funciones como la ubicación en tiempo real, grabación de audio y el envío de una señal de auxilio a través de nuestra aplicación a quienes se encuentren sincronizados con la cuenta.', 'SECURITY TECH S.A.', 119, 5);
INSERT INTO COMPAÑIA VALUES(1239, 'https://drive.google.com/drive/9zqjU3yqQMvEn5zE4MNCYjG2Wzdh6qUQr', 'se ha visto como esta contaminado nuestro mar, un recurso al que el ser humano recurre para mantenerse, este problema se ha visto ya hace años, un problema al que muchas personas intentan salvarlo y otras no le toman importancia, por ello mi grupo ha decidido tomar este tema para sacar un producto o servicio en la cual beneficie a la humanidad como a la VIDA SUBMARINA; reciclar objetos sólidos, realizar productos con esto y buscar la manera de descomponerlo para saber cuales sustancias pueden beneficiar a la vida submarina y al ser humano.', 'SESWO (SEEKING TO SAVE THE WORLD)BUSCANDO SALVAR EL MUNDO', 112, 1);
