INSERT INTO COMPAÑIA VALUES(1243, 'https://drive.google.com/drive/nrGcFbSm3R3v3SHFwJUrwUFWvnitXY9wR', 'En la actualidad cuando nos sentimos mal o nos duele algo lo primero que hacemos es ir a la farmacia y comprar el medicamento que nos indiquen, pero es algo que deberíamos cambiar ya que a un largo plazo los medicamentos pueden ser adictivos y otra consecuencia es que algunos a su mayor utilidad pueden causar descalcificación de los huesos entre otras muchas mas consecuencias.', 'TAO', 218, 4);
INSERT INTO COMPAÑIA VALUES(1244, 'https://drive.google.com/drive/W5keiMMSuw88mSUzKFAGNGyBvCmbhdLBR', 'Es un producto nutritivo muy agradable y practico de consumir, para combatir la desnutrición elaborado a base de menestras con alto grado en hierro y en diversas presentaciones para niños, adolescentes, mujeres embarazadas y adultos mayores que tienen bajo nivel de hemoglobina y están propensos a sufrir de anemia, fatiga física y mental y problemas cognitivos, entre otros.', 'SUMAQ', 158, 5);
INSERT INTO COMPAÑIA VALUES(1245, 'https://drive.google.com/drive/RGGZaEw8H3HrBbTQwVhA7vFPDXYjcpd5E', 'Nuestros usuarios son las personas que salen a trabajar y usan mascarilla constantemente. El problema que hemos encontrado son las mascarillas desechables, ya que cuando una se ensucia o se desgasta, la desechamos en la basura, sin embargo, muchas veces estas mascarillas son encontradas en el mar y esto hace que contamine el hábitat de mucho de los animales marinos. Por eso nuestra propuesta de valor es brindar mascarillas ecológicas en apoyo a la ecología y a la vez reducir la contaminación del mar.', 'ECO MASK', 101, 1);
INSERT INTO COMPAÑIA VALUES(1246, 'https://drive.google.com/drive/BP5kdwCrHAVNhKrv2iNaMwKNU5BdtUd8f', 'Nuestro producto es un gel  que tiene distintos olores de las plantas más comunes del Perú que son Aloe Vera, La menta y Eucalipto.  La función de el aroma de las plantas ayuda para poder desestresarse y también para los dolores de cabeza. El gel también tiene otra función que es protegerse de las bacterias en este caso lo más importante es cuidarnos del covid.', 'QAPHICHSUÑA', 211, 5);
