INSERT INTO COMPAÑIA VALUES(1248, 'https://drive.google.com/drive/GvACNWazfVdJPDc94av5VWnuMJ6EuYfaR', 'Nuestro proyecto es hacer una Tablet la cual lleve acabo diferentes tipos de funciones, garantizando el bien físico, emocional como psicológico, apoyando también a no dejar de lado el socializar, esta tableta tendrá a un avatar que será como otra persona a través de la pantalla.', 'FADE', 218, 4);
INSERT INTO COMPAÑIA VALUES(1249, 'https://drive.google.com/drive/CcbNY65HZzgvadmNXZ2YRundcVyGDf5Vh', 'Nuestros usuarios son las personas que viven cerca a lugares propensos a desastres naturales identificamos que debido al cambio climático han habido muchos desastres naturales el Survival Kit tiene un cargado solar en caso de emergencia. Además incluye el nombre personalizados para evitar confusiones,  también con la mochila se puede tener acceso a un manual con números de emergencia ', 'SURVIVAL KIT', 126, 5);
INSERT INTO COMPAÑIA VALUES(1250, 'https://drive.google.com/drive/nGKWaSJDMhZJZLzU6ySM9WSXhGnyVGkch', 'Nuestro producto busca facilitar la labor de los repartidores (indistintamente de la empresa en la que trabajen) sin que tengan que invertir demasiado dinero, brindándoles los productos que necesitaban antes y ahora con la pandemia a buen precio, de modo que lo podrían adquirir de forma individual o las empresas podrían comprar los paquetes para sus empleados.', 'PILLU ATYNAYA', 118, 1);
INSERT INTO COMPAÑIA VALUES(1251, 'https://drive.google.com/drive/L7V8YMJ8yktmMEvLgkdX9cKEmXG5NHD5q', 'Usuario: todas las mujeres de nuestro país que son victimas de violencia de género Problema: las injusticias y los abusos hacia las  mujeres y las niñas. Propuesta de valor: servicio que apoyara  este problema a través de charlas, blog de paginas , elaboración de videos, se brindará el apoyo emocional a las victimas de violencia de género y así  tomar conciencia logrando un cambio en la mentalidad machista. Además compartiremos información mediante las redes sociales.', 'FEMALE SUPPORT GROUP ', 175, 1);
INSERT INTO COMPAÑIA VALUES(1252, 'https://drive.google.com/drive/8nnTiTBM5MKGuGaAUvfnj2xQUev7p9tuN', 'ReFood proporciona itinerarios de comidas saludables que ayuden a nuestro usuario a mantener una alimentación estable, nosotros escogimos el ODS de Producción y consumo responsable, nos basamos en las consecuencias que trae un consumo irresponsable de carnes a las personas, el problema de nuestro usuario es su excesivo consumo de carnes. Nosotros proponemos, cómo ya mencione, que nuestro cliente lleve una alimentación sana, nuestra página web aparte de brindar itinerarios de comidas, brinda asesoría a nuestros suscriptores.', 'REFOOD', 104, 5);
INSERT INTO COMPAÑIA VALUES(1253, 'https://drive.google.com/drive/yTpaAMKpbqNtKTuKX8uhzvq7CEYM7nNVb', 'Nuestra empresa está  dirigida a las mujeres,  las mujeres no tienen las mismas oportunidades, derechos y respeto que los varones. Contamos historieta de enfoque de género en forma animada y de corta duración y fáciles de entender queremos promover la igualdad de género y empoderar a la mujer  en esta sociedad.', 'HER FOR SHE    ', 101, 1);
INSERT INTO COMPAÑIA VALUES(1254, 'https://drive.google.com/drive/fLqqKnLAm2MHtdrwGuZTpqNhkxZTJHWAB', 'El usuario son personas mayores de 18 años que cuenten con ingresos o ahorros, esta apto para todas las edades.El problema que queremos solucionar es la siguiente ODS: ""Proteger, restablecer y promover el uso sostenible de los ecosistemas terrestres, gestionar sosteniblemente los bosques, luchar contra la desertificación, detener e invertir la degradación de las tierras  y detener la pérdida de biodiversidad"" ', 'LAS TRES R', 214, 3);
INSERT INTO COMPAÑIA VALUES(1255, 'https://drive.google.com/drive/iSjpdMXzkftCzAN9nuHAibc8UZKkStgqL', 'Nuestro producto va dirigido a las personas que hacen deportes o ejercicios de alta intensidad - no pueden comprar una bebida por factores como el tiempo, el dia y el economico - Energizzing es una bebida energizante natural enduzada con stevia al alcance de todos los deportistas con precios bajos.', 'BEBIDAS ENERPERÚ', 171, 4);
INSERT INTO COMPAÑIA VALUES(1256, 'https://drive.google.com/drive/yXAdajKLrxm8wpWWvPifhMTx59e54TEqr', 'En la actualidad con el problema de la pandemia muchos hogares se han  visto afectados económicamente y teniendo un índice de pobreza elevado. Nuestro programa consiste en hacer donaciones a niños y personas vulnerables de bajos recursos económicos, runa es nuestra propuesta para población ya mencionada con materiales reciclados.', 'UNA SONRISA EN TUS MANOS', 171, 3);
INSERT INTO COMPAÑIA VALUES(1257, 'https://drive.google.com/drive/jWkTqGckPinwNhZdfHRYhe7qbKKpyApHd', 'Nuestro producto está dirigido a las personas que están debilitadas en su estado de salud debido al covid-19 y a la mala alimentación  nosotros les damos una solución para que puedan aumentar su sistema inmunológico de las personas en rehabilitación a causa de una enfermedad nuestro producto denominado NATURALLY  consta de  germinados con muchas vitaminas y minerales con un buen sabor para el paladar de las personas.', 'NATURALLY ', 101, 0);
INSERT INTO COMPAÑIA VALUES(1258, 'https://drive.google.com/drive/pWM99CWa2MN9W2EdGrUK3zSpdmZcLcGew', 'Esta situación que hasta la fecha nos tiene en una fatal incertidumbre principalmente en el sector salud, que es lo primordial, ante todo, nos conlleva a ofrecer un producto útil y sobre todo necesario para de alguna manera contrarrestar esta ola de contagios que viene arrasando y azotando tanto a nuestro país  y el mundo, nos referimos a las innova mascarillas,  las que seguiremos utilizando así haya vacuna.', 'NOVA', 158, 4);
